name: My Product Page Workflow

permissions:
  contents: write

on:
  push:
    branches:
      - main
      - master

jobs:
  build:
    runs-on: ubuntu-latest
    steps:
      - name: Deploy Product Github Page
        uses: OpenCatalogi/productpage-action@latest
        with:
          github_repository_name_as_prefix: false
          github_repository_url: https://github.com/OpenCatalogi/publiccode-action
          github_api_base_url: https://api.github.com/repos/OpenCatalogi/publiccode-action/contents

          # Links
          SLACK_URL: "https://samenorganiseren.slack.com/archives/C049GJ0QNHW"
          READ_THE_DOCS_URL: "false"

          navbar_content: 'https://raw.githubusercontent.com/OpenCatalogi/publiccode-action/master/docs/NavbarContent.json'
          footer_show_logo: true
          footer_logo_href: "https://opencatalogi.nl/"
          footer_content: 'https://raw.githubusercontent.com/OpenCatalogi/publiccode-action/master/docs/FooterContent.json'
          footer_content_header: "heading-3"
          jumbotron_title: "Publiccode Action"
          jumbotron_subtitle: "Bouw automatisch een publiccode.yaml en post deze naar Open Catalogi"
          jumbotron_description: "De catalogi service verbind landelijke catalogi zo als developer.overheid.nl, commponentencatalogus.commonground.nl en internationale catalogi zo als github en gitlab met het Open Catalogi federatieve netwerkt"
          jumbotron_image: "data:image/svg+xml;base64,"
          favicon_image: "data:image/svg+xml,%3Csvg id='ez32vdyXlYm1' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink' viewBox='0 0 79 79' shape-rendering='geometricPrecision' text-rendering='geometricPrecision'%3E%3Cimage width='79' height='79' xlink:href='data:image/png;base64,' preserveAspectRatio='xMidYMid meet'/%3E%3C/svg%3E%0A"
          page_title: "Publiccode Action"
          nl_design_theme_classname: "rotterdam-theme"
          pull_from_branche: "development"